import React, { useState } from 'react';
import SignIn from './Components/googleSignIn/signIn'; // Replace with your actual login component path
import './App.css'; // Import your CSS styles (optional)

function App() {
  const [isActive, setIsActive] = useState(false);

  const handleRegisterClick = () => {
    setIsActive(true);
  };

  const handleLoginClick = () => {
    setIsActive(false);
  };

  return (
    <div className={`App ${isActive ? 'active' : ''}`}>
      <button id="register" onClick={handleRegisterClick}>Register</button>
      <button id="login" onClick={handleLoginClick}>Login</button>
      <SignIn />
    </div>
  );
}

export default App;
